.text
main:
#Inicio, pedir seed, pintar display
la $a0, preguntaSeed
li $v0, 4
syscall			#Print
li $v0, 5
syscall			#Leer int.
addi $a0,$zero,1 	#Set seed $a0
add $a1, $zero, $v0	#Set seed $a1
li $v0, 40
syscall

#Paredes aleatorias
addi $t0, $zero, 10 		#Cantidad de obstaculos a inicializar
add $t1, $zero, $zero		#Valor inicial
randomParedesInicio:
beq $t1, $t0, randomFrutaInicial
addi $a0, $zero, 1
li $v0, 41
syscall				#Numero random

abs $a0, $a0
rem $a0, $a0, 496
mul $a0, $a0, 4			#Valor para buscar en la matriz

la $s2,matriz
add $s2, $s2, $a0
addi $t2, $zero, 1		#Escribir 1 (pared)
lw $t3, 0($s2)
bne $t3, 0, randomParedesInicio
sw $t2, 0($s2)
addi $t1, $t1, 1
j randomParedesInicio
#Fin


#Inicio ingresar fruta inicial
randomFrutaInicial:
addi $a0, $zero, 1
li $v0, 41
syscall

abs $a0, $a0
rem $a0, $a0, 496
mul $a0, $a0, 4

la $s2,matriz
add $s2, $s2, $a0
addi $t0, $zero, 5
lw $t1, 0($s2)
bne $t1, 0, randomFrutaInicial
sw $t0, 0($s2)
#Fin
j pintar

