li $v0, 41
syscall
abs $a0, $a0
rem $a0, $a0, 496
mul $a0, $a0, 4
la $t5,matriz
add $t5, $t5, $a0
addi $t0, $zero, 5
lw $t1, 0($t5)
beq $t1, 1, nuevaFruta
beq $t1, 6, nuevaFruta
beq $t1, 2, nuevaFruta
sw $t0, 0($t5)
#fin 


la $a1,display
pintar:
la $s0,matriz
la $s1,cosas
