addi $s0,$s0,4
lw $t1,0($s0)
beq $t1,-1,fin
j While
fin:
j polling

MOSTRAR:
add $t6, $a0, $zero			# t6 direccion de los inicios de los cuadros a pintar
add $t7, $a1, $zero			# t7 direccion del display
addi $t5, $zero, 0			# columna actual
WHILE_COLUMNA:				# mientras mostremos una columna
lw $t1, 0($t6)				# cargamos la palabra de la direccion de memoria del array
beq $t1, 1, SALTAR_FILA   		# si nos encontramos con un uno hay que saltar a la siguiente fila
sw $t1, 0($t7)                  	# si no nos saltamos la fila, entonces copiamos el valor al display
salta:
addi $t6, $t6, 4                   	
addi $t7, $t7, 4                  	
j WHILE_COLUMNA
SALTAR_FILA:                      	
addi $t6, $t6, 4                  	# Nos movemos al siguiente elemento 
lw $t1, 0($t6)                    	# cargamos el siguiente elemento
beq $t1, 1, FIN_MOSTRAR           	  
addi $t5, $t5, 1                  	  
mul $t1, $t5, 2048			
add $t7, $a1, $t1			
j WHILE_COLUMNA                   	# mostramos la siguiente columa
FIN_MOSTRAR:				# Encontramos dos unos seguidos asi que terminamos
jr $ra



polling:
addi $a0, $zero, 100	# cada 100 ms
addi $v0, $zero, 32     # esperamos (syscall 32 sleep)
syscall		        # esperamos 100ms para no utilizar todo el procesador
la $a0,ingreso
#addi $a1,$zero,2
#addi $v0,$zero,8
#syscall
#la $t0,ingreso
addi $t0, $zero, 0xffff0004
lw $t1, 0($t0)
beq $t1,113, perderPared
beq $t1,119, arriba		#Si la tecla corresponde a "w" entonces salta a arriba	
beq $t1,115, abajo		#"s" abajo
beq $t1,97, izquierda		#"a" izquierda
beq $t1,100, derecha		#"d" derecha
j polling				#Continua la lectura de teclado

arriba:
la $s3,posicionInicial			#Carga la direccion de memoria de la posicion inicial
lw $t5,0($s3)				#Carga la palabra de la direccion de memoria en $t5
la $s2,matriz				#Carga la direccion de memoria de la matriz tablero
addi $t7,$zero,0			#Guarda en $t7 lo que supone hay en el tablero en la posicion del cursor como valor inicial 
add $s2,$s2,$t5				#En $s2 la posicion del jugador en el tablero, desde ahora posicion
lw $t6,0($s2)	
sw $t7,0($s2)				#Una vez que encuentra lo que hay en el tablero, lo guarda en este, en la posicion correspondiente
addi $t5,$t5,-128			#Mueve tanto la posicion del cursor como la posicion que revisa del tablero una posicion arriba
addi $t7,$zero,2			
addi $s2,$s2,-128			
lw $t6,0($s2)
beq $t6, 0, nadaArr
beq $t6, 5, manzanaArr 		# 5 es el numero de la manzana.
beq $t6, 1, perderPared		# 1 es pared, si toca pierde
manzanaArr:
sw $t7,0($s2)
sw $t5,0($s3)
jal sumarPuntaje
j nuevaFruta
nadaArr:
sw $t7,0($s2)				#Guarda en la matriz tablero, lo que queda en el tablero despues del movimiento
sw $t5,0($s3)
j pintar

		
abajo:
la $s3,posicionInicial
lw $t5,0($s3)
la $s2,matriz
addi $t7,$zero,0
add $s2,$s2,$t5
lw $t6,0($s2)
sw $t7,0($s2)
addi $t5,$t5,128			
addi $t7,$zero,2			
addi $s2,$s2,128
lw $t6,0($s2)
beq $t6, 0, nadaAb
beq $t6, 5, manzanaAb 		
beq $t6, 1, perderPared		# 1 es pared, si toca pierde
manzanaAb:
