lw $t5,0($s3)
la $s2,matriz
addi $t7,$zero,0
add $s2,$s2,$t5
lw $t6,0($s2)
sw $t7,0($s2)
addi $t5,$t5,4			
addi $t7,$zero,2		
addi $s2,$s2,4
lw $t6,0($s2)
beq $t6, 0, nadaDer
beq $t6, 5, manzanaDer 		
beq $t6, 1, perderPared		# 1 es pared, si toca pierde
manzanaDer:
